import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Hero from './components/Hero';
import Highlights from './components/Highlights'
import Footer from './components/Footer';
import $ from 'jquery';
import CookieBanner from 'react-cookie-banner';
export default class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      foo: 'bar',
      resumeData: {}
    };

  }

  getResumeData(){
    $.ajax({
      url:'/resumeData.json',
      dataType:'json',
      cache: false,
      success: function(data){
        this.setState({resumeData: data});
      }.bind(this),
      error: function(xhr, status, err){
        console.log(err);
        alert(err);
      }
    });
  }

  componentDidMount(){
    this.getResumeData();
  }
 render(){
   return(
     <div>
       <CookieBanner styles={{
    banner: { backgroundColor: '#F2F2F2' }
  }}
      message="By accessing and using this website, you acknowledge that you have read and
      understand our Cookie Policy, Privacy Policy, and our Terms of Service."
      onAccept={() => {}}
      cookie="user-has-accepted-cookies" />
       <Hero data={this.state.resumeData.data} />
       <Highlights/>
       <Footer/>
     </div>
   )
 }
}
